import React from 'react';

function About() {
  const [hoveredButton, setHoveredButton] = useState(null);

    const handleMouseEnter = (button) => {
        setHoveredButton(button);
    };

    const handleMouseLeave = () => {
        setHoveredButton(null);
    };
  return (
    <div>
      <header>
        <h2>LifeLens</h2>
        <nav style={{
            position: 'fixed',
            top: 0,
            left: 0,
            width: '100%',
            height: '80px', // Set a fixed height
            display: 'flex',
            justifyContent: 'space-between', // Space between the buttons
            alignItems: 'center',
            backgroundColor: 'black',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', // Optional shadow for visibility
            zIndex: 1000
        }}>
          <div style={lifelens}>
                LifeLens
            </div>
            <div style={{ display: 'flex', justifyContent: 'flex-end' }}>
                <div
                    style={hoveredButton === 'about' ? { ...buttonStyle, ...buttonHoverStyle } : buttonStyle}
                    onClick={() => window.location.href = "/about"}
                    onMouseEnter={() => handleMouseEnter('about')}
                    onMouseLeave={handleMouseLeave}
                >
                    ABOUT
                </div>
                <div
                    style={hoveredButton === 'services' ? { ...buttonStyle, ...buttonHoverStyle } : buttonStyle}
                    onClick={() => window.location.href = "/services"}
                    onMouseEnter={() => handleMouseEnter('services')}
                    onMouseLeave={handleMouseLeave}
                >
                    SERVICES
                </div>
                <div
                    style={hoveredButton === 'signin' ? { ...buttonStyle, ...buttonHoverStyle } : buttonStyle}
                    onClick={() => window.location.href = "/sign-in"}
                    onMouseEnter={() => handleMouseEnter('signin')}
                    onMouseLeave={handleMouseLeave}
                >
                    SIGN IN
                </div>
            </div>
        </nav>
      </header>
    
    <div style={{
      display: 'grid',
      gridTemplateColumns: 'repeat(5, 1fr)',
      gap: '20px',
      justifyContent: 'center',
      padding: '20px'
    }}>
      {[...Array(5)].map((_, index) => (
        <div
          key={index}
          style={{
            backgroundColor: 'transparent',
            width: '190px',
            height: '254px',
            perspective: '1000px',
            fontFamily: 'sans-serif'
          }}
        >
          <div style={{
            position: 'relative',
            width: '100%',
            height: '100%',
            textAlign: 'center',
            transition: 'transform 0.8s',
            transformStyle: 'preserve-3d',
          }}
            className="flip-card-inner"
            onMouseEnter={(e) => e.currentTarget.style.transform = 'rotateY(180deg)'}
            onMouseLeave={(e) => e.currentTarget.style.transform = 'rotateY(0deg)'}
          >
            <div style={{
              boxShadow: '0 8px 14px 0 rgba(0,0,0,0.2)',
              position: 'absolute',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center',
              width: '100%',
              height: '100%',
              backfaceVisibility: 'hidden',
              border: '1px solid coral',
              borderRadius: '1rem',
              background: 'linear-gradient(120deg, bisque 60%, rgb(255, 231, 222) 88%, rgb(255, 211, 195) 40%, rgba(255, 127, 80, 0.603) 48%)',
              color: 'coral'
            }}>
              <p style={{ fontSize: '1.5em', fontWeight: '900', textAlign: 'center', margin: 0 }}>FLIP CARD</p>
              <p>Hover Me</p>
            </div>
            <div style={{
              boxShadow: '0 8px 14px 0 rgba(0,0,0,0.2)',
              position: 'absolute',
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center',
              width: '100%',
              height: '100%',
              backfaceVisibility: 'hidden',
              border: '1px solid coral',
              borderRadius: '1rem',
              background: 'linear-gradient(120deg, rgb(255, 174, 145) 30%, coral 88%, bisque 40%, rgb(255, 185, 160) 78%)',
              color: 'white',
              transform: 'rotateY(180deg)'
            }}>
              <p style={{ fontSize: '1.5em', fontWeight: '900', textAlign: 'center', margin: 0 }}>BACK</p>
              <p>Leave Me</p>
            </div>
          </div>
        </div>
      ))}
    </div>
    </div>
  );
};

export default About;


const buttonStyle = {
    cursor: 'pointer',
    width: '184px',
    height: '45px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '1rem',
    fontSize: '1.125em',
    fontWeight: '800',
    letterSpacing: '2px',
    color: 'black',
    backgroundColor: '#644dff',
    border: '2px solid #4836bb',
    borderRadius: '0.75rem',
    boxShadow: '0 8px 0 #4836bb',
    transform: 'skew(-10deg)',
    transition: 'all 0.1s ease',
    filter: 'drop-shadow(0 15px 20px rgba(101, 77, 255, 0.39))',
    marginTop: '-10px', // Adjust to move up
    marginRight: '10px'
};

const buttonHoverStyle = {
    letterSpacing: '0px',
    transform: 'skew(-10deg) translateY(8px)',
    boxShadow: '0 0 0 rgba(101, 77, 255, 0.39)', // Update shadow color
};

const lifelens ={
    color: '#644dff',
    width: '184px',
    height: '45px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '1rem',
    fontSize: '2em',
    fontWeight: '800',
    letterSpacing: '2px',
    marginLeft:'20px'
}
